import './css/Row.css'

function Row(props) {
  return (
    <div className='row' >
      <h2>{props.title}</h2>

      <div className='row_posters'>
        <img src="https://image.tmdb.org/t/p/original//o8zk3QmHYMSC7UiJgFk81OFF1sc.jpg" className='rowposter'/>
      </div>

    
    </div>
  )
}

export default Row
